import React, { useState } from "react";
import Card from "./Card"
import OperationBox from "./OperationBox";
import Parenthesis from "./Parenthesis";


function App() {
    const [operation, setOperation] = useState("");
    const [isActive, setIsActive] = useState([
        {
            id: 0,
            bool: true,
        },
        {
            id: 1,
            bool: false,
        },
        {
            id: 2,
            bool: false,
        }]);
        const [isActivePar, setIsActivePar] = useState([
            {
                id: 0,
                bool: true,
            },
            {
                id: 1,
                bool: false,
            },
            {
                id: 2,
                bool: false,
            }]);

    const [boxes, setBoxes] = useState([
        {
            id: 0,
            number: 5,

        },
        {
            id: 1,
            number: 7,

        },
        {
            id: 2,
            number: 10,

        },
        {
            id: 3,
            number: 9,

        }

    ])

    function arithmetics(event) {
        const x = event.target.value;
        if (isActive) {
            setOperation(x);
        }
    }

    function handleClickPar(id){
        const updateActivity = isActive.map(i => {
            if (i.id === id) {
                return {
                    ...i,
                    bool: true
                }
            }
            else {
                return {
                    ...i,
                    bool: false
                }
            }
        })
        setIsActivePar(updateActivityPar);
    }
    function handleClickOP(id) {
        const updateActivity = isActive.map(i => {
            if (i.id === id) {
                return {
                    ...i,
                    bool: true
                }
            }
            else {
                return {
                    ...i,
                    bool: false
                }
            }
        })
        setIsActive(updateActivity);
    };

    const swapBoxes = (fromBox, toBox) => {
        let fromNumber = boxes[fromBox.id].number;
        let toNumber = boxes[toBox.id].number;

        const updateBox = boxes.map(box => {
            if (box.id === fromBox.id) {
                return {
                    ...box,
                    number: toNumber,
                }
            } else if (box.id === toBox.id) {
                return {
                    ...box,
                    number: fromNumber,
                }
            } else {
                return box;
            }
        });
        setBoxes(updateBox);
    };

    const handleDragStart = data => event => {
        let fromBox = JSON.stringify({ id: data.id });
        console.log(fromBox)
        event.dataTransfer.setData("dragContent", fromBox);

    };

    const handleDragOver = data => event => {
        event.preventDefault(); // Necessary. Allows us to drop.
        return false;
    };

    const handleDrop = data => event => {
        event.preventDefault();

        let fromBox = JSON.parse(event.dataTransfer.getData("dragContent"));
        let toBox = { id: data.id };
        swapBoxes(fromBox, toBox);

        return false;
    };

    return (

        <div>
            <h1>This is 24</h1>

            <div className="height">
                <Parenthesis text="(" />
                <Card number={boxes[0].number} id={0} draggable={"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop={handleDrop} />
                <OperationBox boolean={isActive[0].bool} onChecked={handleClickOP} text={operation} id={0} />
                <Parenthesis text="(" />
                <Card number={boxes[1].number} id={1} draggable={"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop={handleDrop} />
                <Parenthesis text=")" />
                <OperationBox boolean={isActive[1].bool} onChecked={handleClickOP} text={operation} id={1} />
                <Parenthesis text="(" />
                <Card number={boxes[2].number} id={2} draggable={"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop={handleDrop} />
                <Parenthesis text=")" />
                <OperationBox boolean={isActive[2].bool} onChecked={handleClickOP} text={operation} id={2} />
                <Card number={boxes[3].number} id={3} draggable={"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop={handleDrop} />
                <Parenthesis text=")" />
            </div>
            <br />
            <br />
            <div>
                <button onClick={arithmetics} className='arith' value="*">*</button>
                <button onClick={arithmetics} className='arith' value="/">/</button>
                <button onClick={arithmetics} className='arith' value="+">+</button>
                <button onClick={arithmetics} className='arith' value="-">-</button>
            </div>
            <br />

        </div>

    );
}

export default App;
